INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (119901, 0, "2023/12/22 12:00:00", 2.17, 450, "2023/12/27 11:59:59", 1, 3, 1, 0, "ミヤコ（クリスマス）", "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 1, 0, 119901, 0, 0, 14, 1, 0, 119901, 302, "みやこ", 119901);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (120001, 0, "2024/03/22 12:00:00", 2.375, 450, "2024/03/28 11:59:59", 1, 3, 1, 0, "シズル（ノワール）", "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 5, 0, 120001, 0, 0, 6, 5, 0, 120001, 190, "しずる", 120001);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (120101, 0, "2015/04/01 15:00:00", 0.0, 0, "2030/12/31 15:00:00", 0, 3, 0, 0, "イオ（ノワール）", "", 7, 0, 0, 0, 0, 0, 7, 0, 0, 0, "いお", 120101);
