INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (191301, 0, "2015/04/01 15:00:00", 2.22, 450, "2030/12/31 15:00:00", 1, 1, 1, 0, "カズマサ", "【物理】皆から愛される漁師町のポンコツ漁師。\nユニオンバーストは強力なスタン効果を持つが、\n自身のＨＰが50%以下では尻もちをついてしまう。\n\n・通常攻撃とユニオンバーストを駆使して戦う。", 6, 0, 191301, 0, 0, 0, 6, 0, 191301, 850, "かずまさ", 191301);
